Este poema se titula "Las alas de amor" o "Las alas del amor" y es atribuido al poeta español José Zorrilla (aunque hay algunas fuentes que lo atribuyen a otros autores). Es un poema romántico que utiliza la figura mitológica de Cupido (Amor) para crear una alegoría sobre las consecuencias de jugar con el amor.
